import React from "react";
import Header from "../components/Header";
import Footer from "../components/Footer";

const Pharmacy = () => {
    return(
        <div className="pharmacy">
            <Header/>
            <section className="pharmacysection">

                <h3>Find NearBy Pharmacy's</h3>
                <br />
                {/* <iframe src="https://www.google.com/maps/embed?pb=!1m16!1m12!1m3!1d498371.65362274623!2d79.99166709241355!3d12.6132929863659!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!2m1!1sNearby%20Pharmacy!5e0!3m2!1sen!2sin!4v1743771070620!5m2!1sen!2sin" 
                width="800" height="650" allowfullscreen="" loading="lazy" referrerpolicy="no-referrer-when-downgrade"></iframe> */}

            </section>
            <Footer/>
        </div>
    )
}

export default Pharmacy;
